import './style.css';
import { Link, Outlet } from "react-router-dom";

const Header = () => {
  return (
    <>
    <header>
      <Link to="/">Home</Link>
      <Link to="/Api">Api</Link>
    </header>

    <Outlet />

    <footer> 2022</footer>
    </>


  )
}


export default Header;
